import React from 'react'

const ProjectName = (props) => {
  console.log("checkprops", props.namevalue);
  const {projectName,logo,status,duration}=props.namevalue;
  return (
    <div className='project'>
        <div className="project_name">
            <h2 className="project_name_projectname">{projectName}</h2>
            <span className="project_name_logoUrl"> {logo}</span>
            <div className='project_name_status'>
            <span className="project_name_status_spans">{status}</span>
            </div>
        </div>
        <div>
            <span className="project_duration">Duration:{duration}</span>
        </div>
    </div>
  )
}

export default ProjectName;
